import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { getCategories } from "../Redux/Action";
import img from "../images/No.jpg";

const Categories = () => {
  const [load, setLoad] = useState(true);
  const dispatch = useDispatch();
  const category = useSelector(({ getCategories }) => getCategories.payload);

  useEffect(() => {
    dispatch(getCategories()).then((res) => setLoad(false));
  }, []);

  let navigate = useNavigate();

  const catshop = (id) => {
    navigate("/categoryShop/" + id);
  };
  return (
    <>
      <div class="shop-area pt-100 pb-100">
        <div class="container">
          <div class="section-title-tab-wrap mb-40">
            <div
              class="section-title-2"
              data-aos="fade-up"
              data-aos-delay="200"
            >
              <h2>Categories</h2>
            </div>
          </div>
          <div class="row flex-row-reverse">
            <div class="col-12">
              <div class="shop-bottom-area">
                <div class="tab-content jump">
                  <div id="shop-1" class="tab-pane">
                    <div class="row">
                      {Array.isArray(category) && category?.length !== 0 ? (
                        category?.map((data) => (
                          <div class="col-lg-3 col-md-4 col-sm-6 col-12">
                            <div class="product-wrap mb-35">
                              <div class="product-img img-zoom mb-25">
                                <a onClick={() => catshop(data?.id)}>
                                  <img
                                    src={
                                      process.env.REACT_APP_BASE_URL +
                                      data?.categoryImage
                                    }
                                    style={{ borderRadius: "10px" }}
                                    alt={data?.categoryName}
                                    onError={({ currentTarget }) => {
                                      currentTarget.onerror = null;
                                      currentTarget.src = img;

                                    }}
                                    alt="image"
                                  />
                                </a>

                                {/* <div class="product-action-wrap">
                                                        <button class="product-action-btn-1" title="Wishlist"><i class="pe-7s-like"></i></button>
                                                        <button class="product-action-btn-1" title="Quick View" data-bs-toggle="modal" data-bs-target="#exampleModal">
                                                            <i class="pe-7s-look"></i>
                                                        </button>
                                                    </div>
                                                    <div class="product-action-2-wrap">
                                                        <button class="product-action-btn-2" title="Add To Cart"><i class="pe-7s-cart"></i> Add to cart</button>
                                                    </div> */}
                              </div>
                              <div class="product-content">
                                <h3
                                  style={{
                                    textTransform: "capitalize",
                                    marginTop: "15px",
                                    fontSize: "22px",
                                    fontWeight: "500",
                                  }}
                                >
                                  <a onClick={() => catshop(data?.id)}>
                                    {data.categoryName}
                                  </a>
                                </h3>
                                {/* <div class="product-price">
                                                        <span class="old-price">$25.89 </span>
                                                        <span class="new-price">$20.25 </span>
                                                    </div> */}
                              </div>
                            </div>
                          </div>
                        ))
                      ) : (
                        <h3 className="container">"No Category Found!"</h3>
                      )}
                    </div>
                    {/* <div class="pagination-style-1">
                                        <ul>
                                            <li><a class="active" href="#">1</a></li>
                                            <li><a href="#">2</a></li>
                                            <li><a href="#">3</a></li>
                                            <li><a class="next" href="#"><i class=" ti-angle-double-right "></i></a></li>
                                        </ul>
                                    </div> */}
                  </div>
                </div>
              </div>
            </div>
          </div>
          {/* mobile menu */}
          <div class="off-canvas-active">
            <a class="off-canvas-close">
              <i class=" ti-close "></i>
            </a>
            <div class="off-canvas-wrap">
              {/* <div class="welcome-text off-canvas-margin-padding">
              <p>Default Welcome Msg! </p>
            </div> */}
              <div class="mobile-menu-wrap off-canvas-margin-padding-2">
                <div id="mobile-menu" class="slinky-mobile-menu text-left">
                  <ul>
                    <li>
                      <a href="/">HOME</a>
                    </li>
                    <li>
                      <a href="/products">SHOP</a>
                    </li>
                    <li>
                      <a href="/categories">CATEGORIES </a>
                    </li>

                    <li>
                      <a href="/aboutus">ABOUT US</a>
                    </li>
                    <li>
                      <a href="/contactus">CONTACT US</a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Categories;
